import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { getEmployees, createEmployee, updateEmployee, deleteEmployee } from "../services/api";
import AddEmployeeModal from "../components/AddEmployeeModal";
import "./EmployeeManagement.css";
import "../assets/css/bootstrap.min.css";

const EmployeeManagement = () => {
    const navigate = useNavigate();
    const [employees, setEmployees] = useState([]);
    const [showAddModal, setShowAddModal] = useState(false);
    const [editEmployee, setEditEmployee] = useState(null);

    useEffect(() => {
        const token = localStorage.getItem("token");
        if (!token) {
            navigate("/login");
        }
        fetchEmployees();
    }, []);

    const fetchEmployees = async () => {
        try {
            const res = await getEmployees();
            setEmployees(res.data);
        } catch (error) {
            console.error("🔴 Error fetching employees:", error);
        }
    };

    const handleCreateOrUpdateEmployee = async (employeeData) => {
        try {
            if (employeeData.id) {
                await updateEmployee(employeeData.id, employeeData);
            } else {
                await createEmployee(employeeData);
            }
            fetchEmployees();
            setShowAddModal(false);
            setEditEmployee(null);
        } catch (error) {
            console.error("🔴 Error saving employee:", error);
        }
    };

    const handleDelete = async (id) => {
        if (window.confirm("คุณแน่ใจหรือไม่ว่าต้องการลบพนักงานนี้?")) {
            try {
                await deleteEmployee(id);
                fetchEmployees();
            } catch (error) {
                console.error("🔴 Error deleting employee:", error);
            }
        }
    };

    return (
        <div className="employee-container">
            <h2>👥 ระบบจัดการพนักงาน</h2>
            <div className="d-flex justify-content-between align-items-center mb-3">
                <button className="btn btn-secondary" onClick={() => navigate("/dashboard")}>⬅️ กลับไปหน้า Dashboard</button>
                <button className="btn btn-primary" onClick={() => setShowAddModal(true)}>➕ เพิ่มพนักงาน</button>
            </div>

            {/* ตารางพนักงาน */}
            <table className="table table-bordered table-striped">
                <thead className="table-dark">
                    <tr>
                        <th>ชื่อ</th>
                        <th>อีเมล</th>
                        <th>เบอร์ติดต่อ</th>
                        <th>ตำแหน่ง</th>
                        <th>สาขา</th>
                        <th>จัดการ</th>
                    </tr>
                </thead>
                <tbody>
                    {employees.map(employee => (
                        <tr key={employee.id}>
                            <td>{employee.name}</td>
                            <td>{employee.email}</td>
                            <td>{employee.phone}</td>
                            <td>{employee.role}</td>
                            <td>{employee.branch_name || "-"}</td>
                            <td>
                                <button className="btn btn-warning btn-sm" onClick={() => { setEditEmployee(employee); setShowAddModal(true); }}>✏️ แก้ไข</button>
                                <button className="btn btn-danger btn-sm ms-2" onClick={() => handleDelete(employee.id)}>❌ ลบ</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            {/* แสดง Modal เมื่อกดปุ่ม "เพิ่มพนักงาน" หรือ "แก้ไขพนักงาน" */}
            {showAddModal && (
                <AddEmployeeModal
                    show={showAddModal}
                    onClose={() => { setShowAddModal(false); setEditEmployee(null); }}
                    onSave={handleCreateOrUpdateEmployee}
                    employeeData={editEmployee}
                />
            )}
        </div>
    );
};

export default EmployeeManagement;
